import React from "react";
import { MDBBtn, MDBContainer,MDBRow,MDBCol,MDBInput } from "mdbreact";

import './../css/design.css';
import offers_jpg2 from './../images/offers_jpg2.jpg';
import heartrate from './../images/heartrate.png';
class ChatComp extends React.Component{

    state = {
        radio: 2
      }

      onClick = (nr) => () => {
        this.setState({
          radio: nr
        });
      }
    render() {
      return (


              <MDBRow className="pl-3 pr-3 mt-5 mt-5">
                <MDBCol lg="6" md="6" sm="12" xs="12">

               <h5><b>Hey Welcome User, chat with our doctors for free</b></h5>
               <p style={{letterSpacing:0,fontSize:12}}>Why wasting time on booking appoints. Consult any doctor when you want.</p>
             <p className="my-4" style={{letterSpacing:0,fontSize:12}}><b>Feel free to tell</b></p>
             <div class="custom-control custom-radio">
  <input type="radio" class="custom-control-input" id="defaultUnchecked" name="defaultExampleRadios"/>
  <label class="custom-control-label" for="defaultUnchecked">Default unchecked</label>
</div>
<div class="custom-control custom-radio">
  <input type="radio" class="custom-control-input" id="defaultUnchecked1" name="defaultExampleRadios1"/>
  <label class="custom-control-label" for="defaultUnchecked1">Default unchecked1</label>
</div>
<div class="custom-control custom-radio">
  <input type="radio" class="custom-control-input" id="defaultUnchecked2" name="defaultExampleRadios2"/>
  <label class="custom-control-label" for="defaultUnchecked2">Default unchecked2</label>
</div>
<div class="custom-control custom-radio">
  <input type="radio" class="custom-control-input" id="defaultUnchecked3" name="defaultExampleRadios3"/>
  <label class="custom-control-label" for="defaultUnchecked3">Default unchecked3</label>
</div>
                </MDBCol>
            <MDBCol  lg="6" md="6" sm="12" xs="12">
            <h5><b>Are you a Doctor?</b></h5>
            <p style={{letterSpacing:0,fontSize:12}}>You can join us help people to improve their health with your help. Are you willing to serve people?</p>
            <MDBBtn color="primary" rounded>Join Now</MDBBtn>

            </MDBCol>
              </MDBRow>



        );
    }




}


export default ChatComp;
